  {name: "辛味噌ネギチャーシュー麺", category: 0, subcategory: 0, taste: 4, ingredients: 3, has_large_sizes: true, is_hot: true, start_sells: "1970-01-01", end_sells: "2099-12-31", start_promote: nil, end_promote: nil, price: 1050, comment: "スープの辛味と本格焼豚。これぞ辛味噌チャーシュー麺！", push_priority: nil},
  {name: "辛味噌つけ麺", category: 0, subcategory: 0, taste: 4, ingredients: 5, has_large_sizes: true, is_hot: true, start_sells: "1970-01-01", end_sells: "2099-12-31", start_promote: nil, end_promote: nil, price: 830, comment: "スープの酸味が決め手の特製つけ麺。冷たい麺をあたたかいスープでどうぞ！", push_priority: nil},
  {name: "サービスセットA", category: 3, subcategory: 4, taste: 6, ingredients: 6, has_large_sizes: true, is_hot: false, start_sells: "1970-01-01", end_sells: "2099-12-31", start_promote: nil, end_promote: nil, price: 690, comment: "ラーメン（醤油・味噌・塩）と、\n人気のミニ丼3種類(チャーシュー丼/ねぎマヨチャーシュー丼/玉子かけご飯)から1種類\nをセットにした、平日ランチタイム限定のとてもお得なメニューです。\nもちろん、中盛・大盛もOK。\n+100円で、辛味噌・特製味噌ラーメンにチェンジできます。\n", push_priority: nil},
  {name: "サービスセットB", category: 3, subcategory: 4, taste: 6, ingredients: 6, has_large_sizes: true, is_hot: false, start_sells: "1970-01-01", end_sells: "2099-12-31", start_promote: nil, end_promote: nil, price: 790, comment: "ラーメン（醤油・味噌・塩）と、\n自慢のパリパリギョウザ、さらにライスがセットになっています。\n平日ランチタイム限定のとてもお得なメニューです。\nもちろん、中盛・大盛もOK。\n+100円で、辛味噌・特製味噌ラーメンにチェンジできます。\n", push_priority: nil},
  {name: "サービスセットC", category: 3, subcategory: 4, taste: 6, ingredients: 6, has_large_sizes: true, is_hot: false, start_sells: "1970-01-01", end_sells: "2099-12-31", start_promote: nil, end_promote: nil, price: 890, comment: "お腹が減ったらこちらがおすすめ！\n山岡家史上最強ボリュームの商品です。\nラーメン（醤油・味噌・塩）と、\n自慢のパリパリギョウザ、さらになんと\nミニ丼3種類(チャーシュー丼/ねぎマヨチャーシュー丼/玉子かけご飯)から1種類がセット！\nもちろん、中盛・大盛もOK。\n+100円で、辛味噌・特製味噌ラーメンにチェンジできます。\n", push_priority: nil},
  {name: "サンデーセット", category: 3, subcategory: 1, taste: 6, ingredients: 6, has_large_sizes: false, is_hot: false, start_sells: "2010-07-25", end_sells: "2099-12-31", start_promote: nil, end_promote: nil, price: 400, comment: "日曜日は、これで決まり！\n各種ラーメンをご注文のお客様に、ギョーザとライスをお得な価格で。\nファミリーでお越しのお客様にもおすすめです。\n", push_priority: nil},
  {name: "ミニチャーシュー丼", category: 1, subcategory: 1, taste: 6, ingredients: 6, has_large_sizes: false, is_hot: false, start_sells: "1985-01-01", end_sells: "2099-12-31", start_promote: nil, end_promote: nil, price: 320, comment: "チャーシューとご飯が溶け合う名脇役。ラーメンとご一緒にどうぞ。\nお米は全て国産米を使用しています。\n", push_priority: nil},
  {name: "半ライス", category: 1, subcategory: 1, taste: 6, ingredients: 6, has_large_sizes: false, is_hot: false, start_sells: "1985-01-01", end_sells: "2099-12-31", start_promote: nil, end_promote: nil, price: 110, comment: "ラーメンと一緒に召し上がっていただくのに、ちょうど良いサイズ。\nお米は全て国産米を使用しています。\n", push_priority: nil},
  {name: "ライス", category: 1, subcategory: 1, taste: 6, ingredients: 6, has_large_sizes: false, is_hot: false, start_sells: "1985-01-01", end_sells: "2099-12-31", start_promote: nil, end_promote: nil, price: 160, comment: "少しお腹が減った時に、ラーメンと一緒にご注文ください。\nスープの染みた海苔とよく合います。\nお米は全て国産米を使用しています。\n", push_priority: nil},
  {name: "ネギマヨチャーシュー丼", category: 1, subcategory: 1, taste: 6, ingredients: 6, has_large_sizes: false, is_hot: false, start_sells: "2011-07-15", end_sells: "2099-12-31", start_promote: nil, end_promote: nil, price: 320, comment: "札幌のメインストリート、狸小路のお店で生み出され、\n今やミニどんぶりの中でオーダー率トップの人気メニュー。\nお米は全て国産米を使用しています。\n", push_priority: nil},
  {name: "玉子かけご飯", category: 1, subcategory: 1, taste: 6, ingredients: 6, has_large_sizes: false, is_hot: false, start_sells: "2010-09-07", end_sells: "2099-12-31", start_promote: nil, end_promote: nil, price: 220, comment: "専用の高級玉子を使用した、山岡家の卵かけごはん。\nオーソドックスな作りですが、その分素材にこだわり、\nそれぞれの食材の旨味を堪能できる一品です。\nお米は全て国産米を使用しています。\n", push_priority: nil},
  {name: "チャーハン", category: 1, subcategory: 1, taste: 6, ingredients: 6, has_large_sizes: false, is_hot: false, start_sells: "2010-09-07", end_sells: "2099-12-31", start_promote: nil, end_promote: nil, price: 280, comment: "山岡家のチャーハン。\n", push_priority: nil},
  {name: "特製ギョーザ", category: 1, subcategory: 1, taste: 6, ingredients: 6, has_large_sizes: false, is_hot: false, start_sells: "1985-01-01", end_sells: "2099-12-31", start_promote: nil, end_promote: nil, price: 290, comment: "ラーメンと並ぶ山岡家の自信作。特製ギョーザ。\n独特のパリパリ感を生み出すため、\n素材はもちろん、調理機材にまでこだわり、\n他では味わえない食感が楽しめます。\n", push_priority: nil},
  {name: "海苔", category: 1, subcategory: 2, taste: 6, ingredients: 6, has_large_sizes: false, is_hot: false, start_sells: "1985-01-01", end_sells: "2099-12-31", start_promote: nil, end_promote: nil, price: 60, comment: "パリパリの高級焼海苔をなんと5枚プラス！\n", push_priority: nil},
