  {start_shows: "1970-01-01 00:00:00", end_shows: "2099-12-31 00:00:00", target_date: "1970-01-01 00:00:00", title: "強烈な個性。", url: "images/top/carousel01.jpg", body: "%h1\n  強烈な個性。\n%p 大量の豚骨を丸３日以上、強い火力で炊き上げるスープは、まさに山岡家の味の核（コア）。\n%p もちろん、ただ煮込み続けているわけではありません。\n%p 鍛え抜かれた匠の技と、緻密な状態管理があってこそ。\n%p 家庭でも、食品工場でも、絶対に表現できない味が、そこにはあります。\n", shop_id: nil, menu_group_id: nil, release_type: 1},
  {start_shows: "1970-01-01 00:00:00", end_shows: "2099-12-31 00:00:00", target_date: "1970-01-01 00:00:00", title: "熟練職人の居場所。", url: "images/top/carousel02.jpg", body: ".gray-bg\n  %h1 熟練職人の居場所。\n  %p 山岡家の誇る熟練職人達は、いつもここでお客様と向き合っています。\n  %p その日の気温、お客様の入り具合、産地から届けられた食材の品質など、\n  %p 様々なファクターで、ラーメンの味は変わってしまいます。\n  %p それらすべてに目を光らせ、その日の最高のラーメンをご提供するのが、彼らの役割。\n  %p 無愛想に見える職人もいるかも知れませんが、お客様に喜んでいただくために、彼らなりに必死なんです。\n", shop_id: nil, menu_group_id: nil, release_type: 1},
  {start_shows: "1970-01-01 00:00:00", end_shows: "2099-12-31 00:00:00", target_date: "1970-01-01 00:00:00", title: "いつもの赤い看板。", url: "images/top/carousel03.jpg", body: ".gray-bg\n  %h1\n    国道沿い25時、深夜のオアシス\n  %p 長距離を移動されて来られたドライバー、残業帰りのお客様。\n  %p そういったお客様を含め、より多くのお客様にほっとする環境をご提供したい… \n  %p その思いから、山岡家はほとんどのお店を24時間営業で運営しています。\n", shop_id: nil, menu_group_id: nil, release_type: 1},
